import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  width: 30%;
  height: 80%;
  background-color: #e9ecef;
  border-radius: 20px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding: 0 80px;
`;

const TitleContainer = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  margin-top: 15px;
`;

const Title = styled.div`
  font-weight: 600;
  font-size: 27px;
  color: #495057;
`;

const SignupForm = () => {
  return (
    <Container>
      <TitleContainer>
        <Title>Signup</Title>
      </TitleContainer>
    </Container>  
  )
};

export default SignupForm;
